import './Contact.css';
import Footer from './Footer';

function Contact() {
    useEffect(() => {
        window.scrollTo(0, 0);
      }, [])
    
    return <div className="container">
        <h1>Contact</h1>
        <Footer></Footer>
    </div>
    
}

export default Contact;
